('laravel_cache_coin_detail_cardano', 'a:29:{s:2:\"id\";s:7:\"cardano\";s:6:\"symbol\";s:3:\"ada\";s:4:\"name\";s:7:\"Cardano\";s:8:\"web_slug\";s:7:\"cardano\";s:17:\"asset_platform_id\";N;s:9:\"platforms\";a:1:{s:0:\"\";s:0:\"\";}s:16:\"detail_platforms\";a:1:{s:0:\"\";a:2:{s:13:\"decimal_place\";N;s:16:\"contract_address\";s:0:\"\";}}s:21:\"block_time_in_minutes\";i:0;s:17:\"hashing_algorithm\";N;s:10:\"categories\";a:10:{i:0;s:23:\"Smart Contract Platform\";i:1;s:12:\"Layer 1 (L1)\";i:2;s:17:\"Cardano Ecosystem\";i:3;s:22:\"Alleged SEC Securities\";i:4;s:20:\"Proof of Stake (PoS)\";i:5;s:18:\"GMCI Layer 1 Index\";i:6;s:13:\"GMCI 30 Index\";i:7;s:10:\"GMCI Index\";i:8;s:11:\"Made in USA\";i:9;s:17:\"Coinbase 50 Index\";}s:15:\"preview_listing\";b:0;s:13:\"public_notice\";N;s:18:\"additional_notices\";a:0:{}s:12:\"localization\";a:34:{s:2:\"en\";s:7:\"Cardano\";s:2:\"de\";s:7:\"Cardano\";s:2:\"es\";s:7:\"Cardano\";s:2:\"fr\";s:7:\"Cardano\";s:2:\"it\";s:7:\"Cardano\";s:2:\"pl\";s:0:\"\";s:2:\"ro\";s:0:\"\";s:2:\"hu\";s:0:\"\";s:2:\"nl\";s:0:\"\";s:2:\"pt\";s:7:\"Cardano\";s:2:\"sv\";s:0:\"\";s:2:\"vi\";s:7:\"Cardano\";s:2:\"tr\";s:7:\"Cardano\";s:2:\"ru\";s:14:\"Кардано\";s:2:\"ja\";s:9:\"エイダ\";s:2:\"zh\";s:9:\"艾达币\";s:5:\"zh-tw\";s:9:\"艾達幣\";s:2:\"ko\";s:9:\"에이다\";s:2:\"ar\";s:14:\"كاردانو\";s:2:\"th\";s:7:\"Cardano\";s:2:\"id\";s:7:\"Cardano\";s:2:\"cs\";s:0:\"\";s:2:\"da\";s:0:\"\";s:2:\"el\";s:0:\"\";s:2:\"hi\";s:0:\"\";s:2:\"no\";s:0:\"\";s:2:\"sk\";s:0:\"\";s:2:\"uk\";s:0:\"\";s:2:\"he\";s:0:\"\";s:2:\"fi\";s:0:\"\";s:2:\"bg\";s:0:\"\";s:2:\"hr\";s:0:\"\";s:2:\"lt\";s:0:\"\";s:2:\"sl\";s:0:\"\";}s:11:\"description\";a:34:{s:2:\"en\";s:485:\"Cardano is a proof-of-stake blockchain platform designed to support decentralized applications (dApps), featuring a multi-asset ledger and smart contract functionality. Unlike many other blockchains, Cardano is built from the ground up based on original academic research, with proposed solutions undergoing peer review and presentation at international conferences before development. The platform emphasizes a research-driven and formal methods approach to design and implementation.\";s:2:\"de\";s:0:\"\";s:2:\"es\";s:0:\"\";s:2:\"fr\";s:0:\"\";s:2:\"it\";s:0:\"\";s:2:\"pl\";s:0:\"\";s:2:\"ro\";s:0:\"\";s:2:\"hu\";s:0:\"\";s:2:\"nl\";s:0:\"\";s:2:\"pt\";s:0:\"\";s:2:\"sv\";s:0:\"\";s:2:\"vi\";s:0:\"\";s:2:\"tr\";s:0:\"\";s:2:\"ru\";s:0:\"\";s:2:\"ja\";s:454:\"エイダコインの通貨単位はADAで総発行数は320億ADA、取引承認システムはウロボロスと呼ばれるPoS(プルーフオブステーク)を採用しています。\r\nエイダコインの開発はイーサリアムやbitshares(ビットシェアーズ)を開発した天才数学者といわれているチャールズホスキンソン氏です。運営はCardano Fundation(カルダノ財団)によって行われています。\";s:2:\"zh\";s:0:\"\";s:5:\"zh-tw\";s:0:\"\";s:2:\"ko\";s:7118:\"에이다는 금융,다양한 분야에 응용 프로그램을 실행할 수 있는 블록체인 응용 플랫폼이자 하스켈 프로그래밍 언어로 구축된 최초의 3세대 블록체인 가상화폐입니다.\r\n\r\n1세대 블록체인인 비트코인은 화폐로서 기능에만 충실한 코인이며, 여기에 계약서 작성 등의 추가적인 기능을 더한 것이 2세대인 이더리움입니다. 에이다는 여기서 한 발 더 나아가 헌법을 정하여 해당 틀 안에서 변화를 인정하는 수단을 가능하게 했습니다.\r\n\r\n즉 에이다 소유자는 프로토콜 변경 방법, 이해 관계자 의도를 파악하는 방법, 파편화 가능성을 줄이는 방법 등에 투표할 수 있습니다. 이렇게 도출된 합의는 하드포크가 아닌 소프트포크를 통해 이뤄집니다. 즉, 에이다 소유자 의견을 수렴한 투표결과를 소프트포크로 구현하여 민주적인 변화를 이끌어내는 블록체인입니다. \r\n\r\n에이다는 Ouroboros라는 안전성이 입증된 Stake 프로토콜을 적용하였으며 매우 복잡하며 안전한 하스켈 프로그래밍 언어로 구축되어 향후 양자컴퓨터가 개발되더라도 해킹에서 매우 안전하도록 설계되었습니다.\r\n\r\nCardano는 안전하고 확장 가능한 방식으로 가치의 복잡한 프로그래밍 가능 전송을 허용하는 분산 플랫폼입니다. Cardano는 매우 안전한 Haskell 프로그래밍 언어로 구축 된 최초의 블록 체인 중 하나입니다. Cardano는 이전에 개발 된 프로토콜보다 더 고급 기능을 제공하고자하는 스마트 계약 플랫폼을 개발 중입니다. 그것은 과학 철학과 연구 중심의 주도적 접근에서 진화하는 최초의 블록 체인 플랫폼입니다. 개발 팀은 전문 엔지니어와 연구원으로 구성된 대규모 글로벌 집단으로 구성됩니다.\r\n\r\nCardano는 새로운 분산 경제를 건설하고 신흥 시장에서 금융을 민주화하기 위해 고안된 블록 체인 기술입니다. 카르 다노 (Cardano)는 분산 된 애플리케이션 및 계약을 저렴한 비용으로 안전하고 확장 가능한 방식으로 구축 및 실행할 수있게합니다.\r\n\r\n블록 체인은 세계적으로 변신 가능한 기술이 될 잠재력이 있지만 현재의 솔루션은 규제 감독의 부재, 입증되지 않은 보안을 통한 실험적 소프트웨어 개발, 업데이트를 방해하는 가버넌스 및 장기 계획의 부족과 같은 몇 가지 중요한 문제로 인해 어려움을 겪고 있습니다. 프로토콜의 미래.\r\n\r\nCardano 프로젝트는 다릅니다 : 혁신적인 소프트웨어 아키텍처를 통해 소비자의 개인 정보 보호 및 보호를 유지하면서 규제 감독의 필요성을 공개적으로 제시합니다.\r\n\r\n이 프로토콜은 유연하고 확장 성이 뛰어나고 업계에서 가장 엄격한 학술 및 상업용 소프트웨어 표준으로 개발되고있는 계층화 된 블록 체인 소프트웨어 스택을 특징으로합니다. 카르 다노 (Cardano)는 프로젝트가 시간이 지남에 따라 발전 할 수있게 해주는 민주적 인 통치 시스템을 사용할 것이며 몽상적 인 재무 시스템을 통해 지속 가능하게 자금을 지원할 것입니다.\r\n\r\n의정서\r\n현재 여러 가지 크립토 통화가 존재하며, 블록 체인 기술을 구현하거나 도입하기 시작한 회사와 정부가 승인 된 블록 체인을 통해 효율성을 확보하거나 분산 솔루션을 통해 효율성을 높이기 위해 노력하고 있습니다.\r\n\r\nCardano는 규제를 허용하면서 사용자 개인 정보를 보호 할 수있는 안전하고 지속 가능한 블록 체인을 제공하기 위해 \'기초부터\'설계되어 차별화됩니다. Cardano는 대규모 응용 프로그램을위한 준비가 완료된 성숙한 블록 체인을 목표로합니다.\r\n\r\n기술 혁신\r\n- 카르 다노 (Cardano)는 스테로이드 알고리즘에 대한 획기적인 증거인 Ouroboros를 통합 한 최초의 프로토콜입니다. IOHK 팀은 처음부터 Cardano를 구축하기위한 동료 검토 학술 연구에 힘 입어 \"1 차 원칙\"접근 방식을 채택했습니다.\r\n-이 독창적 인 공동 작업은 분산 시스템, 메커니즘 설계 및 암호화와 같은 분야를 하나로 모으는 제품인 cryptocurrency를 지속적으로 꾸준히 구축했습니다. 그 결과, 하스켈 코드에 기반한 최초의 암호 해독 성이 있습니다.이 코드는 업무 핵심 시스템에 필요한 복원력을 제공하는 산업 강도 제품으로이 경우 투자를 보호합니다.\r\n- Cardano의 다중 레이어 프로토콜은 고급 기능을 수행하고 제어 레이어에 우아하게 연결된 결제 레이어를 기반으로합니다. 결제 계층에는 계정 단위가 있고 제어 계층에는 스마트 계약이 실행되며 신원을 확인하고 규정 준수를 지원하도록 프로그램되어 (예 : 블랙리스트 허용)\r\n-이 프로토콜은 규제 기관의 요구를 고려하면서 사용자의 개인 정보 보호 권리를 보호하기위한 것입니다. 이렇게함으로써 Cardano는 이러한 요구 사항을 미묘하고 효과적인 방식으로 균형을 유지하는 최초의 프로토콜로서 cryptocurrencies에 대한 새로운 접근 방법을 개척했습니다.\r\n- 시스템은 소프트 포크를 통해 업그레이드 할 수 있도록 설계되어 필요에 따라 변화하는 요구 사항에 적응하고 신속하게 진화 할 수 있습니다. 의정서의 지속 가능성을 보장하는 재무 시스템도 설치되고 있습니다.\r\n- 완전 공개 소스 및 특허가없는 Cardano는 협업의 정신으로 만들어졌습니다. 효율성과 확장 성을 위해 설계된 Cardano 에코 시스템은 지금까지 구축 된 가장 완벽한 cryptocurrency로 발전 할 것입니다.\r\n\r\n개념적 혁신\r\n\r\n나는. 개인 정보 보호 및 규제\r\n원래의 Bitcoin 블록 체인은 개인이 은행과 정부의 통제를 벗어난 상태에서 서로 직접 익명으로 거래 할 수있는 방법이었습니다. 이는 금융 거래에서 프라이버시를 보장하며 근본적인 개인 권리입니다. 그러나 완전한 익명 성은 규제 적 감독이 부족한만큼 비생산적 일 수 있습니다. 오늘날 대부분의 블록 체인 프로젝트는 개인 정보 보호 또는 규제의 목표를 향해 나아갑니다. 전 세계적으로 효과를 발휘하기 위해 개인 정보 보호와 규정 통제를 적절히 혼합하여 블록 체인이 \'원을 제곱\'해야한다고 생각합니다.\r\n\r\nii. 통치\r\n공공적이고 분산 된 블록 체인 프로젝트는 군중 기반 거버넌스 모델에 의존합니다. 이를 통해 참여자들의 네트워크를 민주적으로 통제 할 수 있으며, 이는 진정으로 분산 된 경제를 구축하는 데 필수적입니다. 그러나 신중하게 설계하지 않으면 이러한 통제가 잘못 될 수 있습니다. 둘 다\";s:2:\"ar\";s:0:\"\";s:2:\"th\";s:0:\"\";s:2:\"id\";s:0:\"\";s:2:\"cs\";s:0:\"\";s:2:\"da\";s:0:\"\";s:2:\"el\";s:0:\"\";s:2:\"hi\";s:0:\"\";s:2:\"no\";s:0:\"\";s:2:\"sk\";s:0:\"