nuary 2014. Compared with other cryptocurrencies, Dogecoin had a fast initial coin production schedule: 100 billion coins were in circulation by mid-2015, with an additional 5.256 billion coins every year thereafter. As of 30 June 2015, the 100 billionth Dogecoin had been mined. \r\n\r\nDogecoin was created by Billy Markus from Portland, Oregon and  Jackson Palmer from Sydney, Australia. Both wanted to create a fun cryptocurrency that will appeal beyond the core Bitcoin audience. Dogecoin is primarily used as a tipping system on Reddit and Twitter where users tip each other for creating or sharing good content. The community is very active in organising fundraising activities for deserving causes.\r\n\r\nThe developers of Dogecoin haven’t made any major changes to the coin since 2015. This means that Dogecoin could get left behind and is why Shibas are leaving Dogecoin to join more advanced platforms like Ethereum. One of Dogecoin strengths is its relaxed and fun-loving community. However, this is also a weakness because other currencies are way more professional.\r\n\r\nTo purchase Dogecoin, it involves downloading a crypto wallet, setting up a crypto exchange account and then trading away for your desired crypto currency. Once we have set up an account with a DOGE currency exchange and deposited some funds, you are ready to start trading. \";s:2:\"de\";s:0:\"\";s:2:\"es\";s:0:\"\";s:2:\"fr\";s:0:\"\";s:2:\"it\";s:0:\"\";s:2:\"pl\";s:0:\"\";s:2:\"ro\";s:0:\"\";s:2:\"hu\";s:0:\"\";s:2:\"nl\";s:0:\"\";s:2:\"pt\";s:0:\"\";s:2:\"sv\";s:0:\"\";s:2:\"vi\";s:0:\"\";s:2:\"tr\";s:0:\"\";s:2:\"ru\";s:0:\"\";s:2:\"ja\";s:0:\"\";s:2:\"zh\";s:0:\"\";s:5:\"zh-tw\";s:0:\"\";s:2:\"ko\";s:1813:\"처음에 \"joke currency\"라고 불리기도 하면서 장난처럼 시작한 도지코인은 일본 개인 시바 이누를 마스코트로 사용합니다. 이 시바견은 인터넷에서 재미로 사용되던 그림이며, 같은 그림이 코인의 로고로 이용되고 있습니다. 이를 통해 도지코인이 재밌고 친근한 가상화폐라는 점을 강조합니다. 실제로 당장 홈페이지만 접속해도, 아주 쉽게 도지코인 지갑을 설치할 수 있습니다. \r\n\r\n개발자 빌리 마커스는 불법 마약 거래 사이트 실크로드에서 사용되는 비트코인과는 달리, 악용되지 않으면서 더 넓은 인구들의 사용을 위해 도지코인을 만든 것이라고 합니다.\r\n\r\n코인 특징\r\n1. 도지코인은 라이트코인에서 포크된 럭키코인에서 포크되었습니다. 그래서 처음에는 럭키코인처럼 채굴보상이 랜덤이었는데, 이후 정해진 보상으로 정책을 바꿨습니다. \r\n\r\n2. 도지코인은 빠른 코인 생산 속도를 가지고 있습니다. 처음에는 생산량이 1,000억 개로 고정돼있었는데, 무제한 생산으로 바뀌었습니다. 현재 10,000개의 코인이 1분마다 생겨나는 중이고, 1년에는 52억 개의 새로운 도지코인이 생겨납니다. 2015년 6월 30일 1,000억 개의 코인이 이미 생산되었습니다. \r\n\r\n3. 도지코인은 SNS에서 팁을 줄 수 있는 시스템을 통해 인기를 얻었습니다. 즉, 도지코인을 이용해 사용자들이 흥미롭거나 가치 있는 콘텐츠를 제공한 사람에게 팁을 주는 것입니다. 레딧, 트위터, 트위치티비(Twitch.TV)등에서 이런 서비스를 제공하는 도지팁봇(Dogetipbot)이 등장하기도 했으나 현재 사용 가능한 팁봇은 제한적입니다. \";s:2:\"ar\";s:0:\"\";s:2:\"th\";s:0:\"\";s:2:\"id\";s:0:\"\";s:2:\"cs\";s:0:\"\";s:2:\"da\";s:0:\"\";s:2:\"el\";s:0:\"\";s:2:\"hi\";s:0:\"\";s:2:\"no\";s:0:\"\";s:2:\"sk\";s:0:\"\";s:2:\"uk\";s:0:\"\";s:2:\"he\";s:0:\"\";s:2:\"fi\";s:0:\"\";s:2:\"bg\";s:0:\"\";s:2:\"hr\";s:0:\"\";s:2:\"lt\";s:0:\"\";s:2:\"sl\";s:0:\"\";}s:5:\"links\";a:13:{s:8:\"homepage\";a:1:{i:0;s:20:\"http://dogecoin.com/\";}s:10:\"whitepaper\";s:0:\"\";s:15:\"blockchain_site\";a:5:{i:0;s:31:\"https://blockchair.com/dogecoin\";i:1;s:26:\"https://doge.tokenview.io/\";i:2;s:36:\"http://dogechain.info/chain/Dogecoin\";i:3;s:25:\"https://3xpl.com/dogecoin\";i:4;s:27:\"https://www.oklink.com/doge\";}s:18:\"official_forum_url\";a:0:{}s:8:\"chat_url\";a:0:{}s:16:\"announcement_url\";a:0:{}s:12:\"snapshot_url\";N;s:19:\"twitter_screen_name\";s:8:\"dogecoin\";s:17:\"facebook_username\";s:16:\"OfficialDogecoin\";s:29:\"bitcointalk_thread_identifier\";i:361813;s:27:\"telegram_channel_identifier\";s:0:\"\";s:13:\"subreddit_url\";s:34:\"https://www.reddit.com/r/dogecoin/\";s:9:\"repos_url\";a:2:{s:6:\"github\";a:2:{i:0;s:36:\"https://github.com/dogecoin/dogecoin\";i:1;s:35:\"https://github.com/dogecoin/libdohj\";}s:9:\"bitbucket\";a:0:{}}}s:5:\"image\";a:3:{s:5:\"thumb\";s:78:\"https://coin-images.coingecko.com/coins/images/5/thumb/dogecoin.png?1696501409\";s:5:\"small\";s:78:\"https://coin-images.coingecko.com/coins/images/5/small/dogecoin.png?1696501409\";s:5:\"large\";s:78:\"https://coin-images.coin