('laravel_cache_coin_detail_ethereum', 'a:30:{s:2:\"id\";s:8:\"ethereum\";s:6:\"symbol\";s:3:\"eth\";s:4:\"name\";s:8:\"Ethereum\";s:8:\"web_slug\";s:8:\"ethereum\";s:17:\"asset_platform_id\";N;s:9:\"platforms\";a:1:{s:0:\"\";s:0:\"\";}s:16:\"detail_platforms\";a:1:{s:0:\"\";a:2:{s:13:\"decimal_place\";N;s:16:\"contract_address\";s:0:\"\";}}s:21:\"block_time_in_minutes\";i:0;s:17:\"hashing_algorithm\";s:6:\"Ethash\";s:10:\"categories\";a:15:{i:0;s:23:\"Smart Contract Platform\";i:1;s:12:\"Layer 1 (L1)\";i:2;s:18:\"Ethereum Ecosystem\";i:3;s:12:\"FTX Holdings\";i:4;s:27:\"Multicoin Capital Portfolio\";i:5;s:20:\"Proof of Stake (PoS)\";i:6;s:26:\"Alameda Research Portfolio\";i:7;s:36:\"Andreessen Horowitz (a16z) Portfolio\";i:8;s:18:\"GMCI Layer 1 Index\";i:9;s:13:\"GMCI 30 Index\";i:10;s:25:\"Delphi Ventures Portfolio\";i:11;s:24:\"Galaxy Digital Portfolio\";i:12;s:10:\"GMCI Index\";i:13;s:33:\"World Liberty Financial Portfolio\";i:14;s:17:\"Coinbase 50 Index\";}s:15:\"preview_listing\";b:0;s:13:\"public_notice\";N;s:18:\"additional_notices\";a:0:{}s:12:\"localization\";a:34:{s:2:\"en\";s:8:\"Ethereum\";s:2:\"de\";s:8:\"Ethereum\";s:2:\"es\";s:8:\"Ethereum\";s:2:\"fr\";s:8:\"Ethereum\";s:2:\"it\";s:8:\"Ethereum\";s:2:\"pl\";s:8:\"Ethereum\";s:2:\"ro\";s:8:\"Ethereum\";s:2:\"hu\";s:8:\"Ethereum\";s:2:\"nl\";s:8:\"Ethereum\";s:2:\"pt\";s:8:\"Ethereum\";s:2:\"sv\";s:0:\"\";s:2:\"vi\";s:8:\"Ethereum\";s:2:\"tr\";s:8:\"Ethereum\";s:2:\"ru\";s:14:\"Эфириум\";s:2:\"ja\";s:18:\"イーサリアム\";s:2:\"zh\";s:9:\"以太坊\";s:5:\"zh-tw\";s:9:\"以太幣\";s:2:\"ko\";s:12:\"이더리움\";s:2:\"ar\";s:12:\"يثريوم\";s:2:\"th\";s:8:\"Ethereum\";s:2:\"id\";s:8:\"Ethereum\";s:2:\"cs\";s:0:\"\";s:2:\"da\";s:0:\"\";s:2:\"el\";s:0:\"\";s:2:\"hi\";s:0:\"\";s:2:\"no\";s:0:\"\";s:2:\"sk\";s:0:\"\";s:2:\"uk\";s:8:\"Ethereum\";s:2:\"he\";s:0:\"\";s:2:\"fi\";s:0:\"\";s:2:\"bg\";s:0:\"\";s:2:\"hr\";s:0:\"\";s:2:\"lt\";s:0:\"\";s:2:\"sl\";s:0:\"\";}s:11:\"description\";a:34:{s:2:\"en\";s:1085:\"Ethereum is a global, open-source platform for decentralized applications. In other words, the vision is to create a world computer that anyone can build applications in a decentralized manner; while all states and data are distributed and publicly accessible. Ethereum supports smart contracts in which developers can write code in order to program digital value. Examples of decentralized apps (dapps) that are built on Ethereum includes tokens, non-fungible tokens, decentralized finance apps, lending protocol, decentralized exchanges, and much more.\r\n\r\nOn Ethereum, all transactions and smart contract executions require a small fee to be paid. This fee is called Gas. In technical terms, Gas refers to the unit of measure on the amount of computational effort required to execute an operation or a smart contract. The more complex the execution operation is, the more gas is required to fulfill that operation. Gas fees are paid entirely in Ether (ETH), which is the native coin of the blockchain. The price of gas can fluctuate from time to time depending on the network demand.\";s:2:\"de\";s:0:\"\";s:2:\"es\";s:0:\"\";s:2:\"fr\";s:0:\"\";s:2:\"it\";s:0:\"\";s:2:\"pl\";s:0:\"\";s:2:\"ro\";s:0:\"\";s:2:\"hu\";s:0:\"\";s:2:\"nl\";s:0:\"\";s:2:\"pt\";s:0:\"\";s:2:\"sv\";s:0:\"\";s:2:\"vi\";s:0:\"\";s:2:\"tr\";s:0:\"\";s:2:\"ru\";s:0:\"\";s:2:\"ja\";s:1370:\"イーサリアム (Ethereum, ETH)・プロジェクトにより開発が進められている、分散型アプリケーション（DApps）やスマート・コントラクトを構築するためのプラットフォームの名称、及び関連するオープンソース・ソフトウェア・プロジェクトの総称である。\r\n\r\nイーサリアムでは、イーサリアム・ネットワークと呼ばれるP2Pのネットワーク上でスマート・コントラクトの履行履歴をブロックチェーンに記録していく。またイーサリアムは、スマート・コントラクトを記述するチューリング完全なプログラミング言語を持ち、ネットワーク参加者はこのネットワーク上のブロックチェーンに任意のDAppsやスマート・コントラクトを記述しそれを実行することが可能になる。ネットワーク参加者が「Ether」と呼ばれるイーサリアム内部通貨の報酬を目当てに、採掘と呼ばれるブロックチェーンへのスマート・コントラクトの履行結果の記録を行うことで、その正統性を保証していく。このような仕組みにより特定の中央管理組織に依拠せず、P2P全体を実行環境としてプログラムの実行とその結果を共有することが可能になった。\";s:2:\"zh\";s:437:\"Ethereum（以太坊）是一个平台和一种编程语言，使开发人员能够建立和发布下一代分布式应用。Ethereum 是使用甲醚作为燃料，以激励其网络的第一个图灵完备cryptocurrency。\r\nEthereum（以太坊） 是由Vitalik Buterin的创建。该项目于2014年8月获得了美国1800万$比特币的价值及其crowdsale期间。\r\n在2016年，Ethereum（以太坊）的价格上涨超过50倍。\";s:5:\"zh-tw\";s:0:\"\";s:2:\"ko\";s:1026:\"이더리움(Ethereum/ETH)은 블록체인 기술에 기반한 클라우드 컴퓨팅 플랫폼 또는 프로그래밍 언어이다. 비탈릭 부테린이 개발하였다.\r\n\r\n비탈릭 부테린은 가상화폐인 비트코인에 사용된 핵심 기술인 블록체인(blockchain)에 화폐 거래 기록뿐 아니라 계약서 등의 추가 정보를 기록할 수 있다는 점에 착안하여, 전 세계 수많은 사용자들이 보유하고 있는 컴퓨팅 자원을 활용해 분산 네트워크를 구성하고, 이 플랫폼을 이용하여 SNS, 이메일, 전자투표 등 다양한 정보를 기록하는 시스템을 창안했다. 이더리움은 C++, 자바, 파이썬, GO 등 주요 프로그래밍 언어를 지원한다.\r\n\r\n이더리움을 사물 인터넷(IoT)에 적용하면 기계 간 금융 거래도 가능해진다. 예를 들어 고장난 청소로봇이 정비로봇에 돈을 내고 정비를 받고, 청소로봇은 돈을 벌기 위해 정비로봇의 집을 청소하는 것도 가능해진다.\";s:2:\"ar\";s:0:\"\";s:2:\"th\";s:0:\"\";s:2:\"id\";s:0:\"\";s:2:\"cs\";s:0:\"\";s:2:\"da\";s:0:\"\";s:2:\"el\";s:0:\"\";s:2:\"hi\";s:0:\"\";s:2:\"no\";s:0:\"\";s:2:\"sk\";s:0:\"\";s:2:\"uk\";s:0:\"\";s:2:\"he\";s:0:\"\";s:2:\"fi\";s:0:\"\";s:2:\"bg\";s:0:\"\";s:2:\"hr\";s:0:\"\";s:2:\"lt\";s:0:\"\";s:2:\"sl\";s:0:\"\";}s:5:\"links\";a:13:{s:8:\"homepage\";a:1:{i:0;s:25:\"https://www.ethereum.org/\";}s:10:\"whitepaper\";s:0:\"\";s:15:\"blockchain_site\";a:7:{i:0;s:21:\"https://etherscan.io/\";i:1;s:63:\"https://platform.arkhamintelligence.com/explorer/token/ethereum\";i:2;s:21:\"https://ethplorer.io/\";i:3;s:31:\"https://blockchair.com/ethereum\";i:4;s:25:\"https://eth.tokenview.io/\";i:5;s:26:\"https://www.oklink.com/eth\";i:6;s:25:\"https://3xpl.com/ethereum\";}s:18:\"official_forum_url\";a:0:{}s:8:\"chat_url\";a:0:{}s:16:\"announcement_url\";a:0:{}s:12:\"snapshot_url\";N;s:19:\"twitter_screen_name\";s:8:\"ethereum\";s:17:\"facebook_username\";s:0:\"\";s:29:\"bitcointalk_thread_identifier\";N;s:27:\"telegram_channel_identifier\";s:0:\"\";s:13:\"subreddit_url\";s:33:\"https://www.reddit.com/r/ethereum\";s:9:\"repos_url\";a:2:{s:6:\"github\";a:8:{i:0;s:39:\"https://github.com/ethereum/go-ethereum\";i:1;s:34:\"https://github.com/ethereum/py-evm\";i:2;s:33:\"https://github.com/ethereum/aleth\";i:3;s:35:\"https://github.com/ethereum/web3.py\";i:4;s:36:\"https://github.com/ethereum/solidity\";i:5;s:36:\"https://