INSERT INTO `posts` (`id`, `judul`, `slug`, `category_id`, `content`, `views`, `image`, `created_at`, `updated_at`, `deleted_at`, `users_id`) VALUES
(1, 'Apa Itu Bitcoin? Panduan Lengkap untuk Pemula', 'apa-itu-bitcoin-panduan-lengkap-untuk-pemula', 2, '<p>Bitcoin adalah mata uang digital terdesentralisasi pertama yang diciptakan oleh Satoshi Nakamoto. Artikel ini menjelaskan cara kerja, sejarah, dan cara membeli Bitcoin.</p>', 1500, 'public/uploads/posts/1743189553Cryptocurrency_logos.jpg', '2025-03-28 11:51:47', '2025-03-28 12:19:13', NULL, 1),
(2, 'Apa Itu Bitcoin? Panduan Lengkap untuk Pemula', 'apa-itu-bitcoin-panduan-lengkap-untuk-pemula', 2, '<p>Bitcoin adalah mata uang digital terdesentralisasi pertama yang diciptakan oleh Satoshi Nakamoto. Artikel ini menjelaskan cara kerja, sejarah, dan cara membeli Bitcoin.</p>', 1500, 'public/uploads/posts/1743189544Blockchain1.jpg', '2025-03-28 11:52:19', '2025-03-28 12:19:04', NULL, 1),
(3, 'Apa Itu Bitcoin? Panduan Lengkap untuk Pemula', 'apa-itu-bitcoin-panduan-lengkap-untuk-pemula', 2, '<p>Bitcoin adalah mata uang digital terdesentralisasi pertama yang diciptakan oleh Satoshi Nakamoto. Artikel ini menjelaskan cara kerja, sejarah, dan cara membeli Bitcoin.</p>', 1500, 'public/uploads/posts/1743189535Cryptocurrency_logos.jpg', '2025-03-28 11:53:00', '2025-03-28 12:18:55', NULL, 1),
(4, 'Apa Itu 3? Panduan Lengkap untuk Pemula', 'apa-itu-3-panduan-lengkap-untuk-pemula', 1, '<p>3 adalah mata uang digital terdesentralisasi pertama yang diciptakan oleh Satoshi Nakamoto. Artikel ini menjelaskan cara kerja, sejarah, dan cara membeli 3.</p>', 1533, 'public/uploads/posts/1743188842Cryptocurrency_logos.jpg', '2025-03-28 11:58:40', '2025-03-30 09:59:39', NULL, 1),
(5, 'Cara Aman Menyimpan Crypto di Wallet', 'cara-aman-menyimpan-crypto-di-wallet', 1, '<p>Simak panduan memilih wallet crypto (hot vs cold wallet) dan tips keamanan untuk menghindari peretasan.</p>', 3201, 'public/uploads/posts/1743188851Blockchain1.jpg', '2025-03-28 11:58:40', '2025-03-30 10:29:14', NULL, 1),
(6, 'Analisis Pasar: Prediksi Harga 4 Tahun 2024', 'analisis-pasar-prediksi-harga-4-tahun-2024', 1, '<p>Bagaimana prospek 4 pasca-upgrade Shanghai? Berikut analisis faktor teknis dan fundamental yang memengaruhi harganya.</p>', 6001, 'public/uploads/posts/1743201556Blockchain1.jpg', '2025-03-28 11:58:40', '2025-03-30 10:29:25', NULL, 1),
(7, '5 Strategi DCA (Dollar-Cost Averaging) untuk Crypto', '5-strategi-dca-dollar-cost-averaging-untuk-crypto', 4, '<p>DCA adalah metode investasi crypto yang mengurangi risiko volatilitas. Pelajari cara menerapkannya dengan optimal.</p>', 2802, 'public/uploads/posts/1743188867Cryptocurrency_logos.jpg', '2025-03-28 11:58:40', '2025-03-30 10:37:48', NULL, 1),
(8, 'NFT 101: Memahami Konsep dan Potensinya', 'nft-101-memahami-konsep-dan-potensinya', 7, '<p>Apa itu NFT? Bagaimana cara membeli dan menjualnya? Temukan jawabannya di panduan komprehensif ini.</p>', 6008, 'public/uploads/posts/1743188875Cryptocurrency_logos.jpg', '2025-03-28 11:58:40', '2025-03-30 10:07:07', NULL, 1),
(9, 'Update: Regulasi Crypto di Indonesia Terbaru 2024', 'update-regulasi-crypto-di-indonesia-terbaru-2024', 1, '<p>Peraturan Bappebti tentang pajak crypto dan batasan transaksi. Bagaimana dampaknya bagi investor?</p>', 6003, 'public/uploads/posts/1743189495Blockchain1.jpg', '2025-03-28 11:58:40', '2025-03-30 12:11:59', NULL, 1),
(10, 'Review 5 Aplikasi Crypto Terbaik untuk Pemula', 'review-5-aplikasi-crypto-terbaik-untuk-pemula', 1, '<p>Bandingkan fitur Binance, Pintu, Tokocrypto, dan lainnya. Mana yang paling user-friendly?</p>', 2200, 'public/uploads/posts/1743189503Cryptocurrency_logos.jpg', '2025-03-28 11:58:40', '2025-03-30 10:30:01', NULL, 1),
(11, '2 Explained: Teknologi di Balik Crypto', '2-explained-teknologi-di-balik-crypto', 1, '<p>Bagaimana 2 bekerja? Apa bedanya dengan database tradisional? Simak penjelasan sederhananya.</p>', 1801, 'public/uploads/posts/1743189511Blockchain1.jpg', '2025-03-28 11:58:40', '2025-03-30 10:33:57', NULL, 1),
(12, 'Cara Mendeteksi Scam Crypto dan Penipuan', 'cara-mendeteksi-scam-crypto-dan-penipuan', 3, '<p>Kenali tanda-tanda proyek crypto palsu, phishing, dan skema Ponzi untuk melindungi aset Anda.</p>', 6000, 'public/uploads/posts/1743189519Cryptocurrency_logos.jpg', '2025-03-28 11:58:40', '2025-03-28 12:18:39', NULL, 1),
(13, 'Memahami Gas Fee 4 dan Cara Menghematnya', 'memahami-gas-fee-4-dan-cara-menghematnya', 1, '<p>Apa itu Gas Fee? Kapan waktu terbaik untuk bertransaksi di 4? Berikut tipsnya.</p>', 2901, 'public/uploads/posts/1743189526Blockchain1.jpg', '2025-03-28 11:58:40', '2025-03-29 02:43:17', NULL, 1);

